// export default ContactPage;
import React from "react";
import  "./contact.css";
import { Footer, Navbar } from "../components";
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css" integrity="sha512-VU8EB5UeVRs5OxVGrBVpjpNMuWVLu9tODPqcW3x9NAfO0F/2bvmkNe+ywXPGbQr4LZl5cA5rD6RpEuL8ScT/Mg==" crossorigin="anonymous" referrerpolicy="no-referrer" />


const ContactPage = () => {
  return (
    <>
      <Navbar />
      <h1 className="text-center">Contact Us</h1>
          <hr />
      <div className="wrapper">
            <div className="left">
              <div className="divs">
              <i class="fas fa-phone"></i>
              <p1>+9541411804</p1>
              <p1>+9817844770</p1>

              </div>
              <div className="divs">
              <i class="fas fa-envelope"></i>


              </div>
              <div className="divs">
              <i class="fas fa-map-marker-alt"></i>

              </div>
            </div>
        <div className="right">
         
          <div className="row my-4 h-10000 bg-blue">
            <div className="col-md-4 col-lg-4 col-sm-8 mx-auto">
              <form>
                <div className="form my-30000 bg-blue">
                  <label htmlFor="Name">Name</label>
                  <input
                    type="text"
                    className="form-control"
                    id="Name"
                    placeholder="Enter your name"
                  />
                </div>
                <div className="form my-3">
                  <label htmlFor="Email">Email</label>
                  <input
                    type="email"
                    className="form-control"
                    id="Email"
                    placeholder="name@example.com"
                  />
                </div>
                <div className="form my-3">
                  <label htmlFor="Message">Message</label>
                  <textarea
                    rows={5}
                    className="form-control"
                    id="Message"
                    placeholder="Enter your message"
                  />
                </div>
                <div className="text-center">
                  <button
                    className="my-2 px-4 mx-auto btn btn-dark"
                    type="submit"
                    disabled
                  >
                    Send
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default ContactPage;
